import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Stats from "./stats"
import Stream from "./stream"

function Home() {
  return (
    <div>
      <Router>
        <Link to={Stream} className="btn btn-primary">hello</Link>
        <Link to={Stats} className="btn btn-primary">hello</Link>
      </Router>
    </div>
  );
}

export default Home;
